import React from 'react';
import { Link } from 'react-router-dom';
import '../Styles/Navbar.css';  

const Navbar = () => {
    return (
        <nav class="navbar">
            <h1>My Website</h1>
            <div class="nav-links">
                <Link to="/">Home</Link>
                <Link to="/first-year">About Me</Link>
                <Link to="/projects">Projects</Link>
                <Link to="/contact">Contact</Link>
            </div>
        </nav>
    );
};

export default Navbar;
